class SMSMobileSendRec{

	String strContent;
	long lTime;

	public SMSMobileSendRec(String strContent){
		this.strContent = strContent;
		lTime = System.currentTimeMillis();
	}
	
	boolean isTimeOut(long lNow){
		if (lNow - lTime >= MsgNotify.MAX_SMS_SEND_TIME)
			return true;
		return false;
	}
}

