	public static final long MAX_SMS_SEND_TIME = 600000;
	public static final int MAX_SMS_NUMBER = 3;
	public static long _lstScanMapTime = 0;
	

	
	private static Map<String, LinkedList<SMSMobileSendRec>> mapSMSMobile = new HashMap<String, LinkedList<SMSMobileSendRec>>();

