	public static void notifyMsg(String mobile, String msg, int notify_fmt){
		notifyMsg(mobile, msg, notify_fmt, 0);
	}	
	
	public static void notifyMsg(String mobile, String msg, int notify_fmt, int type){
		try{
			if ("1".equals(ZLConfigure.getInstance().getInstance().getValue("sms_debug"))){
				System.err.println("============= SMS content = "+msg);
				return;
			}
		}catch(Exception e){}
		
		
		int len = mobile.length();
		if (mobile.length()!=11)
			return;
		if (mobile.endsWith("01234567") || mobile.endsWith("12345678") || mobile.endsWith("00000000"))
			return;
		
		
		try{
			SingletonClient.getClient().sendSMS2(new String[] {mobile }, AFinanceUtils.formatSMSMsg(msg,type), "",5);
			

		} catch (Exception e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}// 带扩展码
		
	}


	public static void sendSMSCheckCode(String mobile, String code){
		
		if (null == code || code.trim().length()==0){
			return;
			//throw new NullPointerException("$$$$$$+sendSMSCheckCode");
		}
		
		System.err.println("============= SMS Code = "+code);
		
		try{
			if ("1".equals(ZLConfigure.getInstance().getInstance().getValue("sms_debug"))){
				return;
			}
			if (mobile.length()==11 && Long.parseLong(mobile)>0){
				try{
					SingletonClient.getClient().sendSMS2(new String[] {mobile }, AFinanceUtils.formatSMSCheckCode(code), "",5);
				} catch (Exception e) {
					// TODO Auto-generated catch block
					e.printStackTrace();
				}// 带扩展码
			}
		}catch(Exception e){}

		
	}
	

